class CaveSystem:
    def __init__(self, n: int, m: int):
        self.n = n
        self.m = m
        self.passages = []
        self.enemy_attack_points = []
        self.enemy_health_points = []
        self.player_health_points = 0
        self.player_attack_points = 0

    def add_passage(self, from_area: int, to_area: int, enemy_attack_points: int, enemy_health_points: int):
        self.passages.append((from_area, to_area, enemy_attack_points, enemy_health_points))

    def get_area_index(self, area_id: int) -> int:
        return area_id - 1

    def traverse(self):
        def get_neighbors(area_id):
            return [passage for passage in self.passages if passage[0] == area_id or passage[1] == area_id]

        def get_enemy_health(area_id):
            return sum(enemy_health_points for from_area, to_area, enemy_attack_points, enemy_health_points in self.passages if from_area == area_id)

        def get_player_health(area_id):
            return self.player_health_points

        def get_player_attack(area_id):
            return self.player_attack_points

        def is_area_safe(area_id):
            return get_enemy_health(area_id) > 0

        def get_area_cost(area_id):
            return 1

        def get_total_cost(area_id):
            neighbors = get_neighbors(area_id)
            return sum(get_area_cost(area_id) + get_total_cost(neighbor[0]) for neighbor in neighbors)

        def breadth_first_search(start_area_id):
            queue = [(start_area_id, 0)]
            visited = set()
            while queue:
                area_id, current_cost = queue.pop(0)
                if area_id in visited:
                    continue
                visited.add(area_id)
                for neighbor in get_neighbors(area_id):
                    if neighbor[0] in visited:
                        continue
                    if is_area_safe(neighbor[0]):
                        next_cost = current_cost + get_total_cost(neighbor[0])
                        if next_cost < get_enemy_health(neighbor[0]):
                            queue.append((neighbor[0], next_cost))
            return visited

        def find_best_path(visited):
            path = [visited.pop()]
            while visited:
                neighbor = min(visited, key=lambda area_id: get_enemy_health(area_id))
                path.append(neighbor)
                visited.remove(neighbor)
            return path[::-1]

        visited = breadth_first_search(1)
        if not visited:
            return "Oh no"

        path = find_best_path(visited)
        for area_id in path:
            total_cost = get_total_cost(area_id)
            self.player_health_points += self.enemy_health_points * (total_cost - 1)
            self.player_attack_points -= self.enemy_attack_points * (total_cost - 1)
            self.enemy_health_points = 0
            self.enemy_attack_points = 0

        return self.player_health_points

